const Jumbotron = () => (
  <div className="card card-image" style={{ backgroundColor: '#00F3FF' }}>
    <div className="text-white text-center rgba-stylish-strong py-5 px-4">
      <div className="py-5">
        <h5 className="h5 orange-text">
          <i className="fas fa-camera-retro"></i> Photography
        </h5>
        <h2 className="card-title h2 my-4 py-2">
          Jumbotron with image overlay
        </h2>
        <p className="mb-4 pb-2 px-md-5 mx-md-5">
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Pariatur
          obcaecati vero aliquid libero doloribus ad, unde tempora maiores,
          ullam, modi qui quidem minima debitis perferendis vitae cumque et quo
          impedit.
        </p>
        <a className="btn peach-gradient">
          <i className="fas fa-clone left"></i> View project
        </a>
      </div>
    </div>

    <style jsx>
      {`
        Jumbotron {
          background-image: linear-gradient(15deg, #18547a 0%, #80d0c7 100%);
          color: #fff;
        }

        li {
          color: #fff;
        }
      `}
    </style>
  </div>
);
export default Jumbotron;
